import React from 'react';
import { View, Text, StyleSheet, Image, Button } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Image
        source={require('./assets/logo.png')} // Updated source path
        style={styles.logo}
      />
      <Text style={styles.welcomeText}>Welcome to DareYou</Text>
      <Text style={styles.title}>Existing Users</Text>
      <Button title="Login" onPress={() => console.log('Login pressed')} />

      <Text style={styles.title}>New Users</Text>
      <Button title="Register" onPress={() => console.log('Register pressed')} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
      flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    backgroundColor: '#001274', // Set the background color to #001274
  },
  logo: {
    width: 100,
    height: 100,
    marginBottom: 20,
  },
    welcomeText: {
    color: 'white', // Set the font color to white
    fontFamily: 'Roboto-Regular', // Set the font to Roboto Regular (assuming you have this font loaded)
    fontSize: 20, // You can adjust the font size as needed
  },
  title: {
    fontSize: 18,
    marginTop: 20,
  },
});
